import React from "react";
import Sidebar from "../components/sidebar";
import { Container, Row, Col } from "react-bootstrap";
import MealViewerTable from "../components/intakes_mealstable";
import SearchBar from "../components/searchbar";
import UserDropdown from "../components/hamburgermenu";

const currentDate = new Date();
const formattedDate = currentDate.toISOString().split('T')[0];

const MealViewer = () => {
  // Sample data
  const dataTemplate = {
    Mealid: 0,
    Date: formattedDate,
    Fats: 0,
    Carbohydrates: 0,
    Protein: 0,
    Foodwaste: 0,
    Foodcombination: ['a','b','c'],
    Description:"Lorem ipsum",
  };


  const [isMenuOpen, setIsMenuOpen] = useState(false); 

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };
  
  const data = Array.from({ length: 30 }, (_, index) => ({
    ...dataTemplate,
    Mealid: index + 1,
    Date: formattedDate,
    Fats: Math.floor(Math.random() * 11),
    Carbohydrates: Math.floor(Math.random() * 11),
    Protein: Math.floor(Math.random() * 11),
    Foodwaste: Math.floor(Math.random() * 11),
  }));

  const handleLogout = () => {
    console.log("Logout clicked");
  };
  


  return (
    <Container fluid>
      <Row>
        <Col md={2}>
          <Sidebar />
        </Col>
        <Col md={10}>
          <div>
            <HamburgerMenu onToggleMenu={toggleMenu} />
            <h2 style={{marginTop:"20px",marginBottom:"20px",color:"#9FC856",fontWeight:"600"}}>Meal Viewer</h2>
            <SearchBar/>
            <MealViewerTable data={data} type={1} />
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default MealViewer;
